import styled from 'styled-components'

export const Container = styled.div`
  .colored:nth-child(1) {
    background:  #fff;
    color: #000;
  }
  .colored:nth-child(2) {
    background: #000;
  }
  .colored:nth-child(3) {
    background: #fff;
  }
  .colored:nth-child(4) {
    background: #000;
  }
`

export const Spacer = styled.div`
  height: 15vh;
  background: #cecece;
`
